import React, { Component } from 'react'

export default class Header extends Component {
    render() {
        return (
            <div>
                <h1>
                    Bobby Nixon
                </h1>
                <nav className="navbar navbar-dark bg-dark mb-3">
                <a className="navbar-brand" href="https://www.linkedin.com/in/bobby-nixon/">
            <h1>LinkedIn<span className="badge badge-secondary">{this.props.totalItems}</span></h1>
          </a>
                <a className="navbar-brand" href="https://github.com/rhanixon">
            <h1>GitHub<span className="badge badge-secondary">{this.props.totalItems}</span></h1>
          </a>
                </nav>
            </div>
        )
    }
}
